      <h2 className="section-title">üî• Trending Recipes</h2>
      <div className="recipe-grid">
        <div className="recipe-card">üçï Spicy Veggie Pizza</div>
        <div className="recipe-card">ü•ó Fresh Greek Salad</div>
        <div className="recipe-card">üçù Creamy Alfredo Pasta</div>
      </div>

      {/* AI Mood-Based Recipe Suggestion */}
      <div className="mood-section">
        <h2>ü§ñ Need a recipe based on your mood?</h2>
        <Link to="/mood-suggestor" className="mood-btn">Get AI Suggestions</Link>
      </div>
    </div>
  );
};

export default Dashboard;
